import React from 'react';
import PropTypes from 'prop-types';

const Department_List = () => {
	return (
		<div className="container">
			<div className="row">
				<div className="col-sm-4 addborder bg-light" />
			</div>
		</div>
	);
};

Department_List.propTypes = {};

export default Department_List;
